// import specific style here
import skillbarStyles from './skillbar.module.scss';

const SkillBar = (props) => {
    return (
        <div className={skillbarStyles.skillBarContainer}>
            <div className={skillbarStyles.skill}>{props.skill}</div>
            <div className={skillbarStyles.statsContainer}>
                <div className={skillbarStyles.stats} style={{ width: `${props.stats}%` }}></div>
            </div>
            {props.stats}%
            <style jsx>{`
                .stats {
                    padding: 0;
                    margin: 0;
                    height: 420px;

                    display: flex;
                    flex-direction: column;
                    justify-content: space-between;
                }

                @keyframes expand {
                    from {
                      transform: rotate(0deg);
                    }
                    to {
                      transform: rotate(359deg);
                    }
                }
            `}</style>
        </div>
    )
}

export default SkillBar;
